import './App.css';
import * as React from 'react';
import { Avatar } from '@mui/material';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';



function App() {
  return (
    <>
    <div className='div1'>
      <Avatar sx={{ width: "23rem", height: "27rem" }} alt="Cindy Baker" src="https://images.hola.com/imagenes/mascotas/20190820147813/razas-perros-pequenos-parecen-grandes/0-711-550/razas-perro-pequenos-grandes-m.jpg?tx=w_680" />
    </div>
    <Stack direction="row" spacing={2}>
      <Button variant="contained">Contained</Button>
      <Button variant="contained" disabled>
        Disabled
      </Button>
      <Button variant="contained" href="#contained-buttons">
        Link
      </Button>
    </Stack>
    <div>{ContainedButtons}</div>
    </>
  );
}



export default App;
